    //  This functoin is going to take the route array and calculate the total length
    //  then divide it up into equal parts equal to the number of minutes it should
    //  take a walking person to navigate the route.
    //
    //  In this case out route, from google maps, is a polyline that has 358 points
    //  but it only takes 3 hours 3 mins to walk, so we need 183 "steps", which in
    //  turn means we can move the player "pointer" along the route by the step each
    //  minute.
    //
    //  The points along the route from google are not evenly spaces so we have to do
    //  a bit of faffing around to do the conversion. We are treating the lat/lon co-ords
    //  as a flat cartesian coordinate system even though obv lat/lon is curved, but it's
    //  such a small area that it doesn't matter.
    makeRoute: function() {

        //  now we need to loop through the route two points at a time to get
        //  the lat/lon pairs.
        var points = [];
        var point = {};

        //  convert the routes array into a points array.
        for (var i = 0; i < this.route.length; i += 2) {
            point = {};
            point.lat = this.route[i];
            point.lon = this.route[i+1];
            points.push(point);
        }

        //  work out the total distance
        var distance = 0;
        var oldPoint = {
            lat: points[0].lat,
            lon: points[0].lon
        };
        var d = null;
        for (var n = 1; n < points.length; n++) {
            d = Math.sqrt(Math.pow(oldPoint.lat - points[n].lat, 2) + Math.pow(oldPoint.lon - points[n].lon, 2));
            distance += d;
            oldPoint.lat = points[n].lat;
            oldPoint.lon = points[n].lon;
        }

        //  Total minutes we need to divide everything into: 60*3 + 3
        //  (Three hours and three minutes walking according to 
        //  google maps)
        //
        //  We'll divide everything down into smaller slices so we
        //  can walk along the route recording every minute point
        //  lets see how this goes
        var firstPoint = {
            lat: points[0].lat,
            lon: points[0].lon
        };

        var nextPoint = {
            index: 1,
            lat: points[1].lat,
            lon: points[1].lon
        };

        var steps = (60*3)+3;
        var distancePerStep = distance / steps;
        var stepPoints = [];
        var stepPoint = {};
        var distanceToNextPoint = 0;

        stepPoint.lat = firstPoint.lat;
        stepPoint.lon = firstPoint.lon;
        stepPoints.push(stepPoint);

        //  now we are going to walk through the steps and walk through the
        //  points...
        for (var s = 1; s <= steps; s++) {

            //  reset the distance to the next step that we
            //  are going to travel along.
            var currentDistanceToNextStep = distancePerStep;
            stepPoint = {};

            distanceToNextPoint = Math.sqrt(Math.pow(firstPoint.lat - nextPoint.lat, 2) + Math.pow(firstPoint.lon - nextPoint.lon, 2));

            //  if the distance we need to move is less than the distance to
            //  the next point, then we can mark down the next step point
            //  as some distance between the current point and the
            //  next one
            while (currentDistanceToNextStep > distanceToNextPoint ) {

                //  remove the distance
                currentDistanceToNextStep -= distanceToNextPoint;

                //  move onto the next point
                firstPoint.lat = nextPoint.lat;
                firstPoint.lon = nextPoint.lon;

                //  and move the next point to it's next
                //  one so we can start walking towards there
                nextPoint.index++;
                if (nextPoint.index >= points.length-1) {
                    nextPoint.lat = points[nextPoint.index-1].lat;
                    nextPoint.lon = points[nextPoint.index-1].lon;
                    break;
                }
                nextPoint.lat = points[nextPoint.index].lat;
                nextPoint.lon = points[nextPoint.index].lon;
                distanceToNextPoint = Math.sqrt(Math.pow(firstPoint.lat - nextPoint.lat, 2) + Math.pow(firstPoint.lon - nextPoint.lon, 2));

            }

            //  If we are here it means the distance to the next step
            //  is somewhere between the fromPoint and the nextPoint
            //  so we need to work out how far between the two points
            //  and set that as our next *step* _and_ set it as our
            //  new from point so we can carry on
            stepPoint.lat = firstPoint.lat + ((nextPoint.lat - firstPoint.lat) * (currentDistanceToNextStep / distanceToNextPoint));
            stepPoint.lon = firstPoint.lon + ((nextPoint.lon - firstPoint.lon) * (currentDistanceToNextStep / distanceToNextPoint));
            stepPoints.push(stepPoint);
            firstPoint.lat = stepPoint.lat;
            firstPoint.lon = stepPoint.lon;

        }

        mapper.stepPoints = stepPoints;

    }


